window.bookSummaryJSON = "<p><b>After I rescued these jerks from a plane crash, you’d think they’d be nicer to me.</b></p> <p><b>I die, like all the time. My track record of hilarious, freak-accidental deaths would be impressive if it weren’t so embarrassing.</b></p> <p><b>And when I come back, I’m naked. Every. Dang. Time.</b></p> <p>After my plane was sabotaged and crashed into the jungle, I rescued five male survivors from the wreckage.</p> <p>I could have let them die, but no, I decided to pull their stupid carcasses from the wreckage. I’m immortal, not a monster.</p> <p>Yes, they’re hot; now is not the time to do something about that.</p> <p>The five sexy jaguar-shifters are on a mission to locate someone, a rare phoenix-shifter. Phoenix, the legendary creature, reborn every time it dies. Wait…</p> <p>…Could they be looking for me?</p> <p>It doesn’t matter since they walked away and left me to die in the Amazon rainforest. A place full of interesting new ways for a klutz like me to die. Surviving the jungle is harsh, but it’s nothing compared to how they have treated me.</p> <p>And the worst part?</p> <p>It turns out these bullies are my fated mates. Yep, I must be cursed.</p> <p>I can’t wait to escape the jungle and leave these guys behind, but another part of me is begging to love them...</p> <p>Was the Amazon always this hot?</p> <p><b><i>But Did You Die is a comedy-filled, bully (first book only) paranormal-romance series that includes shifters, a mysterious underground society, and incredibly clumsy Phoenix. Follow Amaryllis as she discovers who she is and \"collects\" her soulmates along the way! This novel is the first in a new series that is packed with humor, adventure, and passionate scenes to entice and thrill you!</i></b></p> <p><i>The series will have a happy ending...it will just take a little while to get there!</i></p>"; 
